import "./Hidden2.css";

export const Hidden2 = () => {
  return (
    <div className="hidden2Container">
      <span className="overlap">Odaberi anketu</span>
      <div className="hiddenTop2">
        <span className="hiddenTitle2">Welcome Survey</span>
        <img src="\img\Path 694.svg" alt="img" className="hiddenTopImg2" />
      </div>
      <img src="\img\Path 689.svg" alt="img" className="hiddenImg2" />
      <span className="hiddenSpan2">
        Dostupno u <span style={{ color: "#FEC478" }}>Business</span> verziji!
      </span>
      <img src="\img\Snimka zaslona (8).png" alt="img" className="blur2" />
    </div>
  );
};
